import React from 'react';

const About: React.FC = () => {
    return (
        <section id="about" className="about-section">
            <h2>About Me</h2>
            <p>
                Welcome to my portfolio! I am a passionate developer with a love for creating dynamic and responsive web applications. 
                My journey in tech began with a fascination for problem-solving and a desire to bring ideas to life through code.
            </p>
            <p>
                I specialize in front-end development, focusing on building user-friendly interfaces and seamless user experiences. 
                I am proficient in technologies such as React, TypeScript, and CSS, and I continuously strive to learn and adapt to new trends in the industry.
            </p>
            <p>
                In this portfolio, you'll find a collection of my projects that showcase my skills and creativity. 
                I am always open to new opportunities and collaborations, so feel free to reach out!
            </p>
        </section>
    );
};

export default About;
